import React, { Component } from 'react';

class CurrentWeather extends Component {
    constructor(props) {
        super(props);
        this.state = {

        }; 
      } 
    render() { 
//    console.log(this.props.currentweather.weather[0].main);

        return ( 

            <div className="current">


            <h2>Current Weather</h2>
                <ul>    
                <li>Main:{this.props.weather[0].main}</li>
                <li>Description:{this.props.weather[0].description}</li>
                <li>Icon:{this.props.weather[0].icon}</li>
                <li>Feels Like:</li>
                <li>Sunrise: {this.props.sunrise}</li>
                <li>Sunset: {this.props.sunset}</li>
                <li></li>
                </ul>

            </div>


         );


    }
}

export default CurrentWeather;
